import React,{Component, useEffect} from 'react';
import './App.css';
import Intro from '../Intro';
import { render } from '@testing-library/react';

function App() {

  const series = ["viking","money"]

  const state = {
    series:[]
  }
   const did = function(){
    for (let i in series){
      <div>this length of the series is " + series[i])</div>
    }

  }
  return (
    <div className="App">
      <header className="App-header">
        <h1 className="App-title">TV series</h1>
      </header>
      <Intro message=" here is our new app"/>
      <did/>

    </div>
  );

}

export default App;
